import "./App.css";
import { useState } from "react";

function App() {

  const [it , setIt] = new useState();

  function update( e ){
    e.preventDefault();
    setIt(e.target.value);
  }


  return (
    <div className="App">
      <div className="card">
        <div className="title">
          <h1>TO DO LIST </h1>
        </div>

        <div className="additem">
          <input
            className="input"
            type="text"
            placeholder="Add items from here"
            name="item"
            onChange={update}
            value="it.item"
          />
          <button> + </button>
        </div>

        <div className="list">
          <ol>
            <li>{it}</li>
          </ol>
        </div>

        <div> hello </div>
      </div>
    </div>
  );
}
export default App;
